import React from "react";
import { Navigate, Outlet } from "react-router-dom";

const PrivateRootAdmin = ({ logAdmin }) => {
  return <div>{logAdmin ? <Outlet /> : <Navigate to="/" />}</div>;
};

export default PrivateRootAdmin;
